const root = ReactDOM.createRoot(document.getElementById('root'));
function Navbar() {
  let title = "Pokemon React";

  return (
    <div>
      <Link to="/home">
        Home
      </Link>
      <Link to="/pokemons">
        Pokemons
      </Link>
      <Link to="/about">
        About
      </Link>
    </div>
  );
}
root.render(
  <>
    <BrowserRouter>
      <Navbar/>
      <Switch>
        <Route path="/" exact>
          <h1>Use la siguiente api: https://www.themealdb.com/api/json/v1/1/random.php</h1>
          <p>Notese que toda la info esta en ingles.</p>
          <RecipeComponent/>
